import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";import{Utility}from"../../shared/utility.min.js";class ProgrammingLanguageExperienceGraphModel{getProgrammingLanguageExperience=()=>{const e=(new WorkExperienceRepository).getAll(),r={};for(const o of e){if(!o.programmingLanguage||0===o.programmingLanguage.length)continue;if(!o.period.from||!o.period.to)continue;const e=Utility.getNumberOfDays(o.period.from),i=Utility.getNumberOfDays(o.period.to)-e;for(const e of o.programmingLanguage)r[e]||(r[e]=0),r[e]+=i}return r}}export{ProgrammingLanguageExperienceGraphModel};